import React from 'react'
import './index.scss'

const HtmlPreview = ({ src }) => {
    src = 'data:text/html;charset=utf-8,' + escape(src)
    return (
        <iframe
            className="html-preview"
            src="https://s3.ap-southeast-1.amazonaws.com/imt-cm-staging/templates/template_bi5polencoovav4kvcd0_50.html"
            title="html-preview"
        />
    )
}

export default HtmlPreview
